/* eslint-disable react/prop-types */
// @mui material components
import Icon from "@mui/material/Icon";

// Argon Dashboard 2 MUI components
import ArgonBox from "components/ArgonBox";
import ArgonTypography from "components/ArgonTypography";
import ArgonBadge from "components/ArgonBadge";

const hotelsTableData = {
  columns: [
    { name: "hotel", align: "left" },
    { name: "type", align: "left" },
    { name: "location", align: "center" },
    { name: "rooms", align: "center" },
    { name: "staff", align: "center" },
    { name: "expected_income", align: "center" },
    { name: "license_status", align: "center" },
    { name: "paye_status", align: "center" }
  ],
  rows: [
    {
      hotel: (
        <ArgonBox display="flex" alignItems="center" px={1} py={0.5}>
          <ArgonBox display="flex" flexDirection="column">
            <ArgonTypography variant="button" fontWeight="medium">
              BHHR Classic Hotel
            </ArgonTypography>
            <ArgonTypography variant="caption" color="text">
              Liberty dam road
            </ArgonTypography>
          </ArgonBox>
        </ArgonBox>
      ),
      type: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          LUXURY
        </ArgonTypography>
      ),
      location: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
          Jos North
        </ArgonTypography>
      ),
      rooms: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
          45
        </ArgonTypography>
      ),
      staff: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
          62
        </ArgonTypography>
      ),
      expected_income: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
          8,500,000
        </ArgonTypography>
      ),
      license_status: (
        <ArgonBadge variant="contained" color="success" size="xs" badgeContent="RENEWED" container />
      ),
      paye_status: (
        <ArgonBadge variant="contained" color="success" size="xs" badgeContent="PAID" container />
      )
    },
    {
      hotel: (
        <ArgonBox display="flex" alignItems="center" px={1} py={0.5}>
          <ArgonBox display="flex" flexDirection="column">
            <ArgonTypography variant="button" fontWeight="medium">
              Ikemba Guest House
            </ArgonTypography>
            <ArgonTypography variant="caption" color="text">
              7, Kashim Ibrahim street
            </ArgonTypography>
          </ArgonBox>
        </ArgonBox>
      ),
      type: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          STANDARD
        </ArgonTypography>
      ),
      location: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
          Jos North
        </ArgonTypography>
      ),
      rooms: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
          32
        </ArgonTypography>
      ),
      staff: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
          45
        </ArgonTypography>
      ),
      expected_income: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
          5,200,000
        </ArgonTypography>
      ),
      license_status: (
        <ArgonBadge variant="contained" color="error" size="xs" badgeContent="EXPIRED" container />
      ),
      paye_status: (
        <ArgonBadge variant="contained" color="error" size="xs" badgeContent="UNPAID" container />
      )
    }
  ]
};

export default hotelsTableData;
